INSERT INTO `badges` (`id`, `name`, `description`, `img_location`) VALUES
(1, 'Administrator ', 'This badge identifies an account as belonging to a GoodBlox administrator. Only official GoodBlox administrators will possess this badge. If someone claims to be an admin, but does not have this badge, they are potentially trying to mislead you. If this happens, please report abuse and we will delete the imposter\'s account.', '/resources/Administrator-75x75.png'),
(2, 'Super Moderator', 'Users with this badge are super moderators. They have special powers on the GoodBlox forum and are able to delete threads that violate the Community Guidelines. They also have special powers on GoodBlox that allow them to approve or disapprove images that other users upload. Rejected images are immediately banished from the site. They are also able to ban users that violate the Community Guidelines off the site. This badge is granted by invitation only.', 'https://goodblox.xyz/resources/supermoderators-75x75.jpg'),
(3, 'Builders Club', 'Members of the illustrious Builders Club display this badge proudly. The Builders Club is a paid premium service. Members receive several benefits: they get ten places on their account instead of one, they earn a daily income of 15 ROBUX, and they receive the exclusive Builders Club construction hat. (Extra ROBUX can be earned if you donate over $5)', 'https://goodblox.xyz/resources/BuildersClub-125x125.png');
