INSERT INTO `forum_categories` (`id`, `name`, `views`, `threads`, `posts`, `locked`, `cat_title`, `admin_only`, `available`, `description`, `creation_date`) VALUES
(1, 'General Discussion', 0, 212, 376, 0, 1, 0, 1, 'This is the place for conversation about all things GOODBLOX. Posts not pertaining to GOODBLOX will be mercilessly pruned by our crack squad of moderators.', 1),
(2, 'Creations Gallery', 0, 6, 7, 0, 1, 0, 1, 'Discuss your GOODBLOX creations and share the secrets of your success. Post requests for help building and scripting here.', 1),
(3, 'Suggestions, Feedback, and Ideas', 0, 12, 20, 0, 1, 0, 1, 'Do you have a suggestion for how to make GOODBLOX better? Share your feedback here.', 1),
(4, 'Off Topic', 0, 11, 9, 0, 1, 0, 1, 'Feel like talking about stuff other than GOODBLOX? Post here.', 1),
(5, 'Building Help', 0, 0, 0, 0, 2, 0, 1, 'Learn the ins and outs of building structures in GOODBLOX here! Share your techniques with other builders, discuss designs, and draft plans.', 1),
(6, 'Scripting Help', 0, 0, 0, 0, 2, 0, 1, 'Need help with a script you are writing? Need to edit an existing script? Want to share your devious programming skills? For advanced GOODBLOX users.', 1),
(7, 'Technical Problems and Bug Report', 0, 0, 0, 0, 2, 0, 1, 'Are you having trouble installing or upgrading GOODBLOX? Account troubles? Website problems? Have you found a bug? Post here!', 1),
(8, 'Role-Playing', 0, 0, 0, 0, 3, 0, 1, 'Does your Goodbloxian want to fly to the moon? Command a ship? Lay siege to a castle? Start a role-playing thread here.', 1),
(9, 'Rate My Goodbloxian', 0, 0, 0, 0, 3, 0, 1, 'Show the world of GOODBLOX your character. Get feedback on your outfit.', 1),
(10, 'Sports', 0, 0, 0, 0, 4, 0, 1, 'Show off your GOODBLOX athlete. Or just hang out with other GOODBLOX fans.', 1),
(11, 'Music', 0, 0, 0, 0, 4, 0, 1, 'Does your Goodbloxian rock? Let people know. Or just talk about your favorite bands.', 1),
(12, 'Movies/TV/Books\r\n', 0, 0, 0, 0, 4, 0, 1, 'Does your Goodbloxian belong on the silver screen, or in the pages of a novel? Show off your GOODBLOX movie star, discuss your favorite TV series, films, and the books you love.', 1);
