(1, 1, 1, 1, 'Dear GoodBlox User:\n\nWelcome to GoodBlox! We are constantly working to make GoodBlox a fun, safe, creative place for people of all ages.\n\nWe update GoodBlox regularly, so be sure to visit our NEWS section to find out about all the exciting changes.\n\nIf you have questions about how something works, our HELP section is a great place to start. It\'s maintained by the GoodBlox community for the GoodBlox community. There\'s a ton of helpful information, including tutorials and answers to Frequently Asked Questions (FAQs).\n\nFinally, please feel free to post your comments and suggestions in the GoodBlox forums.\n\nThank you!', 'Welcome to GoodBlox', 1568578400, 0),
